import Navbar from "../../Components/navbar/Navbar";
import Header from "../../Components/header/Header";
import Slider from "../../Components/slider/Slider";

export default function Home() {
    let headerProps = {
        // LeftArrow || noAction
        action: "noAction",
        subheader: "active",
        text: "World's News"
    }
    let sliderProps = {
        title: "Scientists identify the most extreme heatwa..",
        subtitle: "climate Change ",
        HighlightText: {
            state: false,
            text: "CLIMATE CHANGE"
        },
        img: [
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            }
        ]
    }

    return (
        <div>
            <Header action = {headerProps.action} text = {headerProps.text}
                    subheader = {headerProps.subheader} />

            <Slider title = {sliderProps.title}
                    subtitle = {sliderProps.subtitle}
                    sliderimg = {sliderProps.img}
                    time = {sliderProps.time}
                    highLightButton = {sliderProps.HighlightText} />

            <Header action = {headerProps.action} text = {headerProps.text = "What's the Impact?"}
                    subheader = {headerProps.subheader = "hidden"} />

            <Navbar />
        </div>
    )
}
